class Solution {
public:
    int findDuplicate(vector<int>& arr) {
        int n = arr.size();
        vector<int> pre(n + 1, 0);
        for(auto i : arr){
            pre[i]++;
        }
        for(int i = 0; i < n;i++){
            if(pre[i] > 1){
                return i;
            }
        }
        return -1;
    }
};
